demo.repl.help:
Galimos komandos:
  @show              ─ rodyti paskutinę adaptyvios kortelės santrauką
  @json              ─ pateikti iš srauto gautą neapdorotą JSON reikšmę
  @back              ─ grįžti į ankstesnę užblokuotą kortelę / įvestis
  @input <k>=<v>     ─ nustatyti arba perrašyti įvesties lauką
  @click <action_id> ─ pateikti kortelę su nurodytu veiksmu
  @help              ─ išspausdinti šį pagalbos tekstą
  @quit              ─ išeiti iš REPL
